import React from 'react';
import { Link } from 'react-router-dom';

const Projects = () => {
  return (
    <section id="projects" className="py-20 px-6">
      <h2 className="text-4xl font-serif text-red-600 mb-6">Projects & Case Studies</h2>

      {/* Main Projects Cards */}
      <div className="grid md:grid-cols-2 gap-6">

        {/* Academic Projects Card */}
        <Link to="/academic-projects" className="border border-red-600 p-6 rounded-lg hover:shadow-lg bg-black">
          <h3 className="text-2xl font-serif text-red-600 mb-2">Academic Projects</h3>
          <p className="text-lg text-white mb-4">Click to view my academic projects.</p>
        </Link>

        {/* Case Studies Card */}
        <Link to="/case-studies" className="border border-red-600 p-6 rounded-lg hover:shadow-lg bg-black">
          <h3 className="text-2xl font-serif text-red-600 mb-2">Case Studies</h3>
          <p className="text-lg text-white mb-4">Click to view my case studies.</p>
        </Link>
      </div>
    </section>
  );
};

export default Projects;
